import React from "react";
import { Card, Avatar, Button } from "antd";

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">
          Twit
          <br />0
        </div>,
        <div key="followings">
          Followings
          <br />0
        </div>,
        <div key="follower">
          Follower
          <br />0
        </div>,
      ]}
    >
      <Card.Meta title="Hyoil" avatar={<Avatar>Hyoil</Avatar>} />
      <Button>Logout</Button>
    </Card>
  );
};

export default UserProfile;
